export const CASiNOS_COL = [
    {
        dataIndex: 'code',
        title: '赌场名称(代码)',
        render: (text, record) => {
            return <>
                <p>{record.name}</p>
                <p>{text}</p>
                </>
        }
    },
    {
        dataIndex: 'ave_price',
        title: '赌场均价',
    },
    {
        dataIndex: 'share',
        title: '赌场份额',
    },
    {
        dataIndex: 'principal',
        title: '赌场本金(元)',
    },
    {
        dataIndex: 'holdingIncomeRate',
        title: '持有收益率(%)',
    },
    {
        dataIndex: 'holdingIncome',
        title: '持有收益额',
    },
    {
        dataIndex: 'expectGrowth',
        title: '今日涨幅(%)',
    },
    {
        dataIndex: 'income',
        title: '今日收益(元)',
    },
    {
        dataIndex: 'expectWorthDate',
        title: '更新时间',
    },
    {
        dataIndex: '',
        title: '操作'
    }
]
